        {
            todo.isCompleted ? 'Completed' : 'Not Completed'
        }
      </div>
      <div className ='card-body'>
        <h4 className = 'card-title'>todo.desc</h4>
        <p className = 'card-text'>some of the text here</p>

      </div>
</div>
    
  )
}

export default Todo
